import "./Header.module.css";
import mealsImg from "../../assets/meals.jpg";

const Header = () => {
	return (
		<header className='header'>
			<h1>ReactMeals</h1>
			<button>Cart</button>
			<div>
				<img src={mealsImg} alt="" />
			</div>
		</header>
	);
};

export default Header;
